import React from "react";
import articleContent from "./article-content";
import { Link } from "react-router-dom";

const ArticleList = () => {
  return (
    <React.Fragment>
      <h1>Articles</h1>
      {articleContent.map((article) => (
        <h3>{article.name}</h3>
      ))}
    </React.Fragment>
  );
};

export default ArticleList;
